import React from 'react';

const VideoItem = (props) => {
    const {channelTitle, title} = props.video.snippet
    const url = props.video.snippet.thumbnails.standard
    return(
    <li>
        <div>
            <img src="`${url}`"/>
            <div>
                <p>{url}</p>
                <span>{channelTitle}</span>
            </div>
        </div>
    </li>            
    );}

export default VideoItem;
